const SearchBar = ({keyword,setKeyword}) => {
  return (
    <input 
     key="random1"
     value={keyword}
     id="appInput" 
     placeholder="Enter Application No."
     onChange={(e) => setKeyword(e.target.value)}
    />
  );
  <h2>Please enter your building permit application number:</h2>
}

